// Importando o React
import React, {Component}from "react";
// Importando os components necessários da lib react-materialize
import { Row, Card } from 'react-materialize';



// Recebe os parâmetros passadados para o Componenet na variável props
class Welcome extends Component {
  render() {
    return (
      <Card>
          <Row>
            <div>
                <h1>BEM VINDO</h1>
                <br/>
                {!this.props.auth.isAuthenticated() &&
                  <a className="waves-effect waves-light btnYe mt20" href={this.props.auth.login} onClick={this.props.auth.login}>LOGIN</a>
                }               
            </div>
          </Row>
      </Card>
    );
  }
};

export default Welcome;
